const mockData = [
  { id: 1, name: "Homeworks", todos: [] },
  {
    id: 2,
    name: "Shopping",
    todos: [
      { id: 1, task: "Apple", done: false },
      { id: 2, task: "Bread", done: false },
      { id: 3, task: "Meat", done: true },
      { id: 4, task: "Milk", done: false },
    ],
  },
  {
    id: 3,
    name: "Others",
    todos: [],
  },
];

export default mockData;
